  `rmb_price` decimal(20,2) DEFAULT '0.00' COMMENT '商品出售价格',
  `market_price` decimal(20,2) DEFAULT '0.00' COMMENT '商品市场价',
  `cost_price` decimal(20,8) DEFAULT '0.00000000' COMMENT '商品成本',
