  `advertising_slogans` varchar(100) DEFAULT NULL COMMENT '广告语',
  `production_date` datetime DEFAULT NULL COMMENT '生产日期',
  `currency_id` varchar(50) DEFAULT NULL COMMENT '币种Id',
